function MainVid(props){
    //get vid here

    return(
        // video
        //video title

        //video author
        //video view
        //likes
        //date

        //desc
        <div className="video">
            <div className="video__nowPlaying">
                <img src={props.image}></img>
            </div>
            <div className="video__title">{props.title}</div>
            <div className="video__info">
                <div>
                    <div className="video__author"> {props.channel}</div>
                    <div className="video__view">{props.views}</div>
                </div>
                <div>
                    <div className="video__likes">{props.likes}</div>
                    <div className="video__date">{props.timestamp}</div>
                </div>
            </div>
            <div className="video__desc"></div>
        </div>
    )
}

export default MainVid;
